webpackJsonp([0xf927f8900006],{618:function(e,a){e.exports={data:{page:{id:"/Users/elyalvarado/Workspace/Personales/blog/content/pages/1--about/index.md absPath of file >>> MarkdownRemark",html:'<p>My name is <strong>Ely Alvarado</strong>. I am a the CTO and cofounder of <a href="https://happythemovement.com">Happy the App</a>, and this is my personal blog.</p>\n<p>I’ve been programming since I was almost 6 years old, when my parents got an Apple IIc computer and I started copying the basic programs from the user manual. Since then, I’ve been involved in the technology world in different roles: PHP programmer, Linux System Administrator, Asterisx VoIP admin, Java Developer, Ruby/Rails developer, JBoss/J2EE application admin, Technology Architect, Technology Manager and Project Manager.</p>\n<p>Right now I’m the CTO/cofounder/lead programmer of my own startup: <em>Happy the App</em>, and for the last three years I’ve been developing the iOS version of the app using Swift over a Ruby on Rails backend. I’m also working on porting it to Android, using Javascript and ReactNative.</p>',frontmatter:{title:"About"}},footnote:{id:"/Users/elyalvarado/Workspace/Personales/blog/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li>Copyright 2018 - Ely Alvarado</li>\n<li>Built with <a href="https://www.gatsbyjs.org/">Gatsby</a> &#x26; <a href="https://reactjs.org">React</a></li>\n</ul>'},site:{siteMetadata:{facebook:{appId:"243640662962998"}}}},pathContext:{slug:"/about/"}}}});
